$primary: #2196f3;
$secondary: #ffffff;

@import url(https://fonts.googleapis.com/css?family=Roboto:100,100italic,300,300italic,regular,italic,500,500italic,700,700italic,900,900italic);

@mixin slowTrans {
    transition: all 0.3s ease;
}
@mixin modalsTrans {
    transition: all 0.7s ease;
}

html {
    font-size: 12px;
}

* {
    margin: 0;
    font-weight: normal;
    text-decoration: none;
    scroll-behavior: smooth;
    box-sizing: border-box;
    font-family: Roboto;
}

button {
    cursor: pointer;
    border: 0;
    background: none;
    outline: none;
}
input {
    border: 0;
    outline: none;
}

.register {
    width: 640px;
    visibility: hidden;
    position: fixed;
    left: 50%;
    z-index: 11;
    top: 50%;
    transform: translate(-50%, -50%);
    margin-top: 150%;
    background: $secondary;
    display: grid;
    grid-template-rows: repeat(2, auto);
    box-shadow: 0px 1px 5px #00000033, 0px 3px 4px #0000001f, 0px 2px 4px #00000024;
    border-radius: 10px;
    @include modalsTrans();
    &-visible {
        visibility: visible;
        margin: 0;
    }
    &-header {
        display: flex;
        align-items: center;
        padding: 0 20px;
        height: 67px;
        &__title {
            font-weight: 500;
            font-size: 20px;
            letter-spacing: 0.15px;
        }
    }
    &-body {
        background: #fafafa;
        padding: 30px 20px 0;
        display: grid;
        grid-template-columns: auto max-content;
        column-gap: 38px;
        align-items: center;
    }
    &-container {
        display: grid;
        grid-template-rows: repeat(3, auto);
        row-gap: 16px;
    }
    &-card {
        display: grid;
        min-height: 56px;
        grid-template-columns: repeat(2, auto);
        grid-template-rows: repeat(2, auto);
        border-radius: 4px 4px 0px 0px;
        border-bottom: 1px solid #000000d7;
        background: #21212114;
        align-items: center;
        padding: 0 10px 0 50px;
        &__title {
            font-size: 12px;
            margin-top: 8px;
            font-weight: 500;
            letter-spacing: 0.4px;
            color: #00000061;
            grid-row: 1 / 2;
            grid-column: 1 / 2;
        }
        &__input {
            grid-row: 2 / 3;
            grid-column: 1 / 2;
            height: 30px;
            background: none;
            letter-spacing: 0.15px;
            color: #000000de;
            font-size: 16px;
            font-weight: 500;
        }
        &__icon {
            margin-left: auto;
            grid-row: 1 / 3;
            display: none;
            grid-column: 2 / 3;
            &-error {
                display: none;
                width: 40px;
                height: 40px;
                border-radius: 50px;
                background: #ff3d3d25;
                justify-content: center;
                align-items: center;
                & img {
                    width: 18px;
                    height: 18px;
                }
            }
        }
        &__errText {
            background: #c5202025;
            grid-column: 1 / 2;
            color: rgb(187, 24, 24);
        }
    }
    &-avatar {
        &__text {
            text-align: center;
            font-weight: 500;
            font-family: Roboto;
            font-size: 1.3rem;
            padding-top: 20px;
            letter-spacing: 0.4px;
            color: #00000061;
        }
        &__icon {
            border-radius: 100px;
            @include slowTrans();
            width: 198px;
            height: 198px;
            cursor: pointer;
            background: center no-repeat url(../../assets/icons/add-avatar.svg);
            &:hover {
                background: center no-repeat url(../../assets/icons/no-avatar.svg);
            }
        }
        &__user-img {
            width: 198px;
            height: 198px;
            display: none;
            border-radius: 100px;
            @include slowTrans();
            &:hover {
                opacity: 0.6;
            }
        }
        &__input {
            display: none;
        }
    }
    &-footer {
        padding: 100px 20px 26px;
        display: flex;
        justify-content: flex-end;
        align-items: center;
        column-gap: 17px;
        border-radius: 0 0 10px 10px;
        background: #fafafa;
        &__btn {
            box-shadow: 0px 0px 2px #0000001f, 0px 2px 2px #0000003d;
            border-radius: 5px;
            display: flex;
            justify-content: center;
            align-items: center;
            text-align: center;
            letter-spacing: 1.25px;
            text-transform: uppercase;
            font-size: 14px;
            font-weight: 500;
            width: 108px;
            height: 36px;
            &:first-child {
                background: $primary;
                color: $secondary;
            }
            &:last-child {
                background: #e3f2fd;
                color: $primary;
            }
        }
    }
}

.substrate {
    position: fixed;
    z-index: 10;
    background: #00000040;
    width: 100%;
    height: 100%;
    @include modalsTrans();
    visibility: hidden;
    opacity: 0;
    &-visible {
        visibility: visible;
        opacity: 1;
    }
}

.result {
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    align-items: center;
    max-width: 360px;
    min-height: 190px;
    padding: 20px 30px;
    visibility: hidden;
    position: fixed;
    left: 50%;
    background-color: $secondary;
    z-index: 11;
    top: 50%;
    transform: translate(-50%, -50%);
    margin-top: 150%;
    @include modalsTrans();
    &-visible {
        visibility: visible;
        margin: 0;
    }
    &-time {
        font-family: Roboto;
        font-size: 26px;
        letter-spacing: 0.25px;
        color: $primary;
        font-weight: 700;
        text-align: center;
    }
    &-text {
        font-family: Roboto;
        font-size: 14px;
        line-height: 20px;
        letter-spacing: 0.25px;
        color: #00000099;
        font-weight: 500;
        &__span {
            font-family: Roboto;
            font-size: 14px;
            line-height: 20px;
            letter-spacing: 0.25px;
            color: #00000099;
            font-weight: 500;
        }
    }
    &-btn {
        width: 100px;
        height: 36px;
        background: $primary;
        box-shadow: 0px 0px 2px rgba(0, 0, 0, 0.12), 0px 2px 2px rgba(0, 0, 0, 0.24);
        border-radius: 4px;
        text-align: center;
        letter-spacing: 1.25px;
        text-transform: uppercase;
        color: $secondary;
        @include slowTrans();
        &:hover {
            background-color: $secondary;
            border: 1px solid $primary;
            color: $primary;
        }
    }
}
